import FileInput from "./FileInput";

export default () => {
  return (
    <div>
      <h3>The FORM:</h3>
      <FileInput />
      <p>
        <button
          onClick={() => {
            fetch("http://localhost:3001/get-orders")
              .then(res => res.json())
              .then(res => {
                console.log(res);
              });
          }}
        >
          GET ORDERS
        </button>
      </p>
    </div>
  );
};
